import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './page/Home';
import Test from './page/Test';


const App = () => {
    return (
        <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/test' element={<Test />} />
        </Routes>
    );
};

export default App;

